import React from "react";

function Header () {
    return (
        <nav className="nav-links">
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>Skills</li>
                <li>Projects</li>
                <li>Contact</li>
            </ul>
        </nav>
    );
}

export default Header;
